    "import pandas as pd\n",
    "from sklearn.tree import DecisionTreeClassifier\n",
    "from sklearn.model_selection import train_test_split\n",
    "from sklearn.metrics import accuracy_score\n",
    "\n",
    "# Load the dataset\n",
    "file_path = 'Prek_HR_data.csv'  \n",
    "data = pd.read_csv(file_path)\n",
    "\n",
    "# Check the columns in the DataFrame\n",
    "print(\"Columns in the DataFrame:\")\n",
    "print(data.columns.tolist())  # Print as a list for easier readability\n",
    "\n",
    "# Strip whitespace from column names\n",
    "data.columns = data.columns.str.strip()\n",
    "\n",
    "# Selecting features and target\n",
    "features = data[['age', 'nqf', 'exp_level']]\n",
    "\n",
    "# Use the correct column name for quality score\n",
    "target = data['q_score']  # Updated to match the actual column name\n",
    "\n",
    "# Split the data\n",
    "X_train, X_test, y_train, y_test = train_test_split(features, target, test_size=0.15, random_state=42)\n",
    "\n",
    "# Initialize and train the decision tree classifier\n",
    "classifier = DecisionTreeClassifier(random_state=42)\n",
    "classifier.fit(X_train, y_train)\n",
    "\n",
    "# Define the candidate profiles to predict their quality scores\n",
    "candidates = pd.DataFrame({\n",
    "    'age': [23, 30, 60, 45, 36],\n",
    "    'nqf': [7, 9, 8, 10, 6],\n",
    "    'exp_level': [1, 3, 3, 8, 10]\n",
    "})\n",
    "\n",
    "# Ensure that the columns in candidates match the training feature names\n",
    "candidates = candidates[features.columns]\n",
    "\n",
    "# Predict the quality score for each candidate\n",
    "predictions = classifier.predict(candidates)\n",
    "\n",
    "# Display the results\n",
    "candidates['predicted_quality_score'] = predictions\n",
    "print(candidates)"
